"use client";
import React, {useState} from 'react';
import {Button} from "@/components/ui/button";

function Page() {
    const arrCities = ['Boston', 'Detroit', "Chicago", "Los Angeles"];
    const [selectedCity, setSelectedCity] = useState('Boston');
    console.log(selectedCity);
    return (
        <div>
            <Button
                onClick={
                    () => {
                        const index = arrCities.indexOf(selectedCity);
                        setSelectedCity(arrCities[(index + 1) % arrCities.length]);
                    }
                }
            >
                Alter City
            </Button>
            <Map selectedCity={selectedCity}/>
        </div>
    );
}

